import { TipoEventoAgenda } from "./Utils";

export type AgendaExp = {
    id: number;
    fechaInicioEvento: Date;
    fechaFinEvento: Date;
    diaCompleto: boolean;
    descripcion: String;
    expedienteId: number;
    documentoExpId: number;
    tipoEventoAgenda: TipoEventoAgenda;  
    actuacionExpIdList: number[];
    expedienteFusionId: number;
}

export const fetchAgendaExp = async () => {
    const endPoint = `https://localhost:8080/test/api/eventos`;
    const data = await (await fetch(endPoint)).json();
    console.log(data);
}
